  false,\n\t\"url\": null,\n\t\"notes\": \"In 2002 and 2003, hydrographic survey data
  were collected using Reson 8101 multibeam echo sounders outfit to 9.8m survey launches.
  Bathymetry data were cleaned of anomalies using Caris HIPS software, creating BASE
  (Bathymetry Associated with Statistical Error)surfaces for each of three survey
  blocks with the CUBE (Combined Uncertainty Bathymetric Estimator) method (Calder
  and Mayer 2003).Accepted XYZ values from the CUBE surface were ultimately converted
  to ESRI Arc ascii grid format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
